import React from 'react';

const HistorySelector = React.memo(function HistorySelector(props) {
  for (var i = 0; i < localStorage.length; i++){
    if (localStorage.key(i).includes('wapp-Rome')) {
      console.log("in here", localStorage.key(i))
    }
    // $('body').append(localStorage.getItem(localStorage.key(i)));
  }

  return(
      <div>
          <select id="lang" onChange={props.handleSelect} >
            <option value="select">Previous Searches</option>
            <option value="Java">Java</option>
            <option value="C++">C++</option>
          </select>
      </div>
  );
});

export default HistorySelector;
